    <nav className="main-nav">
      <div className="main-nav-controls">
        <h1 className="main-nav-brand">LOGO</h1>
        <h1 className="main-nav-toggle">=</h1>
      </div>

      <li className="main-nav-list">
        <a onClick={navigate("/")}>Dashboard</a>
