        <a  onClick={navigate("/all-projects")} >All Projects</a>
        <a  onClick={navigate("/all-employees")} >All Employees</a>
        <a  onClick={navigate("/add-employee")} >Add Employee</a>
      </li>
    </nav>
  );
};

